// File: thumbs/thumbs.sol


pragma solidity ^0.8.9;






contract Thumbs is ERC721, ERC721URIStorage, Pausable, AccessControl {
    using Counters for Counters.Counter;

    uint256 public mintOG_price;
    uint256 public mintWL_price;
    uint256 public mintPublic_price;
    address owner;
    address public treasury;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    mapping(address => bool) public OG_user_addresses;
    mapping(address => bool) public WL_user_addresses;
    mapping(uint256 => bool) public sequence_tokenId;
    mapping(address => uint256) public Og_minted_address;
    mapping(address => uint256) public wl_minted_address;
    mapping(address => uint256) public public_minted_address;
    mapping(uint256 => uint256) public sequence;
    // uint256[] internal sequence;

    bool internal OGMINT;
    bool internal WLMINT;
    bool internal PUBLICMINT;

    uint256 public supply = 5057;
    uint256 public noOfEntry = 0;

    uint256 public mintOG_Limit;
    uint256 public mintWL_Limit;
    uint256 public mintPublic_Limit;
    uint256 public totalSupply;
    string public base_url =
        "https://ipfs.io/ipfs/bafybeigkr5s35poinkiq5idcrycfeyurwywwpxzrazfs27ee2u6le6mwzm/json/";

    //PAID MINT(AUTO-MINT) VARIABLES
    mapping(address => bool) public has_paid;
    mapping(address => uint256) public amount_paid;

    event UserPaid(address indexed _user, uint256 indexed amount);

    struct automint {
        address _user;
        uint256 _amount;
    }

    constructor(address minter) ERC721("Thumbs", "THUMBS") {
        owner = msg.sender;

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);

        _grantRole(DEFAULT_ADMIN_ROLE, minter);
        _grantRole(PAUSER_ROLE, minter);
        _grantRole(MINTER_ROLE, minter);

        totalSupply = 0;
        mintOG_price = 0;
        mintOG_Limit = 2;
    }

    // fallback function

    receive() external payable {
        has_paid[msg.sender] = true;
        amount_paid[msg.sender] = msg.value;

        emit UserPaid(msg.sender, msg.value);
    }

    //PAID AUTO-MINT
    function presaleMint(automint[] memory _users)
        public
        onlyRole(MINTER_ROLE)
    {
        for (uint256 i = 0; i < _users.length; i++) {
            for (uint256 j = 0; j < _users[i]._amount; j++) {
                require(
                    totalSupply + _users[i]._amount <= supply,
                    "supply exceed"
                );

                uint256 newItemId = sequence[totalSupply];
                totalSupply += 1;
                _mint(_users[i]._user, newItemId);
                _setTokenURI(newItemId, gen_uri(newItemId));
            }
        }
    }

    function setMintSupply(uint256 _supply) public onlyRole(DEFAULT_ADMIN_ROLE) {
        supply = _supply;
    }

    // modifires

    modifier _checkUser(uint256 _amount, address _user) {
        require(OGMINT, "OG mint is not open");
        require(totalSupply + _amount <= supply, "supply exceed");
        require(
            OG_user_addresses[_user],
            "user is not whitelisted for og mint"
        );
        require(
            Og_minted_address[_user] <= mintOG_Limit,
            "user mint there nfts"
        );
        require(
            Og_minted_address[_user] + _amount <= mintOG_Limit,
            "execed mint limit"
        );
        require(_amount * mintOG_price <= msg.value, "user pass lower amount");
        _;
    }

    function OGMint(uint256 _amount, address _user)
        public
        payable
        _checkUser(_amount, _user)
    {
        for (uint256 i = 0; i < _amount; i++) {
            uint256 newItemId = sequence[totalSupply];
            totalSupply += 1;
            Og_minted_address[_user] += 1;
            _mint(_user, newItemId);
            _setTokenURI(newItemId, gen_uri(newItemId));
        }
    }

    modifier _checkWhiteListUsers(uint256 _amount, address _user) {
        require(WLMINT, "WL mint is not open");
        require(totalSupply + _amount <= supply, "supply exceed");
        require(
            WL_user_addresses[_user],
            "user is not whitelisted for whitelisted mint"
        );
        require(wl_minted_address[_user] <= mintWL_Limit, "user mint there nfts");
        require(
            wl_minted_address[_user] + _amount <= mintWL_Limit,
            "execed mint limit"
        );
        require(_amount * mintWL_price <= msg.value, "user pass lower amount");
        _;
    }

    function wlMint(uint256 _amount, address _user)
        public
        payable
        _checkWhiteListUsers(_amount, _user)
    {
        for (uint256 i = 0; i < _amount; i++) {
            uint256 newItemId = sequence[totalSupply];
            totalSupply += 1;
            wl_minted_address[_user] += 1;
            _mint(_user, newItemId);
            _setTokenURI(newItemId, gen_uri(newItemId));
        }
    }

    function publicMint(uint256 _amount, address _user) public payable {
        require(PUBLICMINT, "Public mint is not open");
        require(totalSupply + _amount <= supply, "supply exceed");
        require(public_minted_address[_user] <= mintPublic_Limit, "user already mint there nfts");
        require( public_minted_address[_user] + _amount <= mintPublic_Limit, "execed mint limit");
        require(_amount * mintPublic_price <= msg.value, "user pass lower amount");

        for (uint256 i = 0; i < _amount; i++) {
            uint256 newItemId = sequence[totalSupply];
            totalSupply += 1;
            public_minted_address[_user] += 1;
            _mint(_user, newItemId);
            _setTokenURI(newItemId, gen_uri(newItemId));
        }
    }


    function setOgWhiteList(address[] memory _accounts)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        for (uint256 i = 0; i < _accounts.length; i++) {
            OG_user_addresses[_accounts[i]] = true;
        }
    }

    function setWLWhiteList(address[] memory _accounts)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        for (uint256 i = 0; i < _accounts.length; i++) {
            WL_user_addresses[_accounts[i]] = true;
        }
    }

    function treasuryMint(uint256 _amount) public onlyRole(DEFAULT_ADMIN_ROLE) {
        require(totalSupply + _amount <= supply, "supply exceed");
        for (uint256 i = 0; i < _amount; i++) {
            uint256 newItemId = sequence[totalSupply];

            totalSupply += 1;
            _mint(treasury, newItemId);
            _setTokenURI(newItemId, gen_uri(newItemId));
        }
    }

    function setTreasuryWallet(address _account)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        treasury = _account;
    }

    error tokenExist(uint256 _token);

    function setSequence(uint256[] memory _sequence)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        for (uint256 i = 0; i < _sequence.length; i++) {
            if (sequence_tokenId[_sequence[i]] == true) {
                revert tokenExist(_sequence[i]);
            }
            sequence[noOfEntry] = _sequence[i];
            sequence_tokenId[_sequence[i]] = true;
            noOfEntry += 1;
        }
    }

    function setOldSequence(uint256[] memory _sequence)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        for (uint256 i = 0; i < _sequence.length; i++) {
            sequence[noOfEntry] = _sequence[i];
            noOfEntry += 1;
        }
    }

    function resetNoOfEntry(uint256 _no) public onlyRole(DEFAULT_ADMIN_ROLE) {
        noOfEntry = _no;
    }

    function setMintPrice(
        uint256 _OG,
        uint256 _WL,
        uint256 _PUBLIC
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        mintOG_price = _OG;
        mintWL_price = _WL;
        mintPublic_price = _PUBLIC;
    }

    function setMintLimit(
        uint256 _perWalletOGLimit,
        uint256 _perWalletWLLimit,
        uint256 _perWalletPublicLimit
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        mintOG_Limit = _perWalletOGLimit;
        mintWL_Limit = _perWalletWLLimit;
        mintPublic_Limit = _perWalletPublicLimit;
    }

    function setMintType(
        bool _og,
        bool _wl,
        bool _public
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        OGMINT = _og;
        WLMINT = _wl;
        PUBLICMINT = _public;
    }

    function setBaseUrl(string memory _uri)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        base_url = _uri;
    }

    function withdraw() external {
        require(has_paid[msg.sender], "User has not yet paid");
        has_paid[msg.sender] = false;
        amount_paid[msg.sender] = 0;
        bool success = payable(msg.sender).send(amount_paid[msg.sender]);
        require(success, "Ether transfer failed.");
    }

    function withdrawAdmin() external onlyRole(DEFAULT_ADMIN_ROLE) {
        bool success = payable(msg.sender).send(address(this).balance);
        require(success, "Ether transfer failed.");
    }

    // Override Functions

    function _burn(uint256 tokenId)
        internal
        override(ERC721, ERC721URIStorage)
    {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return gen_uri(tokenId);
    }

    function gen_uri(uint256 _tokenid) internal view returns (string memory) {
        return
            string(
                abi.encodePacked(base_url, Strings.toString(_tokenid), ".json")
            );
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

